export default function Navbar() {
    return (
        <><nav className="navbar navbar-light bg-light">
            <span className="navbar-brand mb-0 h1">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Cowin Vaccination Portal</span>
            <div class="col px-mr-5"><button type="button" className="btn btn-primary">Login</button></div>

        </nav></>
    )
}
